let sfw = require('./sfw')
module.exports = {
    soyultro(option) {
        let res
        Object.keys(sfw).filter(key => {
            if (key === option) res = sfw[key]
        })
        if(res) {
            return res[Math.floor(Math.random() * res.length)]
        } else {
            return 'Invalid Request'
        }
    },
}